detail.description:
This is a signaling proposal to redelegate Stride's Cosmos Hub Validator Set. Over the past month-and-a-half, the Stride community has been engaged in the process of selecting a new set of Cosmos Hub validators, for the purpose of delegating the ATOM deposited with Stride. This process has been open, transparent, and decentralized. A set of thirty-two Cosmos Hub validators has been curated, and now it is up to Stride governance to decide whether or not to accept this new set. 

Voting YES indicates that you approve of this validator set, and would like to see ATOM deposited with Stride redelegated to these validators, according to the stated weights.

Voting NO indicates that you disapprove of this validator set, and would like ATOM deposited with Stride to remain delegated to the default validator set. 

The proposed weights are: 

Cohort 1: {Cosmostation: 5.625%, Simply Staking: 5.625%, Lavender.Five Nodes: 5.625 %, Bro_n_Bro: 5.625%} 

Cohort 2: {Informal Systems: 4.375%, Notional: 4.375%, CryptoCrew Validators: 4.375%, IcyCRO: 4.375%}

Cohort 3: {danku_zone: 3.125%, Stakin: 3.125%, Polkachu: 3.125%, B-Harvest: 3.125%}

Cohort 4: {Everstake: 2.875%, Cypher Core: 2.875%, Stakely: 2.875%, blockscape: 2.875%}

Cohort 5: {Wetez: 2.625%, Smart Stake: 2.625%, Blockhunters: 2.625%, Imperator: 2.625%} 

Cohort 6: {Forbole: 2.375%, Frens: 2.375%, Oni Validator: 2.375%, Made in Block: 2.375%} 

Cohort 7: {Genesis Lab: 2.125%, Binary Holdings: 2.125%, AUDIT.one: 2.125%, Provalidator: 2.125%}

Cohort 8: {Citadel.one: 1.875%, Blockdaemon: 1.875%, Golden Ratio Staking: 1.875%, Virtual Hive: 1.875%}}. 

The full proposal and discussion can be found here: https://commonwealth.im/stride/discussion/8550-reset-strides-cosmos-hub-validator-set",

